import React from "react";
import "../style.css";
import back from "../assets/cosmosback.jpg";
const Main = () => {
  return (
    <div className="main-container">
      <h1 className="main-title">Welcome to the Solar System</h1>
      <p className="main-text">Explore planets, stars, and mysteries of space!</p>
      <img  src={back} alt="Solar System" className="background-img" />
    </div>
  );
};

export default Main;
